import React , {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import './blog.css';
import Navbar from './navbar' ;
import Toolbar from './toolbar';
import Tutorials from './tutorials' ;
import Extra_Section from './extra_section' ;
import Plans from './plans' ;
import Contents from './contents' ;
import Social_Medias from './social_medias' ;
import Recent from './recent' ;
import Footer from './footer' ;

function App(){

  const url = "http://karnaval.herokuapp.com/api/service/title?id=0";
  const response = fetch(url ,    {mode: 'no-cors'});


  return (

    <React.Fragment>




<div className="rtl container-fluid container_custom_style ">

<Navbar />

<Toolbar />

    {/* <Tutorials /> */}

  {/* <Extra_Section /> */}




  </div>


  <main role="main" className="rtl container">
  <div className="rtl row">

    <Recent />

    <aside className="rtl col-md-4 blog-sidebar">

            <Plans />
            <Contents />
            <Social_Medias />

    </aside>

  </div>

</main>

<Footer />



    </React.Fragment>




  );
}

export default App;
